import React from "react";

const CartItemD = ({ item }) => {
  const { title, price, description, image } = item;

  return (
    <div>
      <div className=" border-2 gap-2 border-black p-3 flex ">
        <div className=" w-[20%] ">
          <img src={image} alt="Cart image" />
        </div>
        <div className=" flex flex-col justify-around">
          <div className=" flex flex-col  ">
            <h1 className=" text-red-600 ">
              {title.length > 60 ? title.slice(0, 50) + "..." : title}{" "}
            </h1>
            <p>
              {description.length > 60
                ? description.slice(0, 50) + "..."
                : description}
            </p>
          </div>
          <h1> Price {price} </h1>
        </div>
      </div>
    </div>
  );
};

export default CartItemD;
